import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

export default class Query9CRow extends React.Component {
	constructor(props) {
		super(props);

	}

	render() {
		return (
			<div className="query">
				<div className="title">{this.props.event_date}</div>
				<div className="title">{this.props.num_riots}</div>
			</div>
		);
	}
}
